    title: '4" Dual Lens 1080P FHD 1.0MP Dash Camera Car DVR',
    body_html:
      '<p><strong>Features:</strong></p><p>Dual lens dash camera, support to record the front image and rear image of the car, the front and rear image can display on a screen.</p><p>1080P Full HD image quality, record traffic incidents, scenic travel, unexpected moments or any social media worthy video, a more perfect record.</p><p>170 degrees wide view angle (dash camera) with 6-layer films lens, F2.0 large aperture, easy to see the situation on both sides of the road in the day and night.</p><p>Built-in G-sensor three-axis gravity sensor, when there is small collisions, this function can help you lock some important video files, which will not be covered by the loop recording.</p><p>Simply mount it to windshield, connect the power cable, the car camcorder will automatically record whilst driving. Ultra clear 4.0" IPS display for ease of instant playback and menu selection.</p><p><br></p><p><br></p><p><strong>Note: </strong></p><p>1. This dash camera only support DC 12V input voltage, do NOT use on 24V vehicle.</p><p>2. It is suggest to use a high class flash TF card that is more than 8GB, or the screen might be stuck or become a green screen easily.</p><p><br></p><p><br></p><p><strong>Specification:</strong></p><p>Type: Dual Lens Car Dash Camera</p><p>Material: ABS, PC</p><p>Quantity: 1 pc</p><p>Item Color: Black + Golden</p><p>Screen: 4 inch IPS full view screen</p><p>Dash Camera Lens: 1.0MP, 170 degrees wide view angle, F=2.0</p><p>Rear Camera Lens: 140 degrees wide view angle, with 4 LEDs</p><p>Video Resolution: 1920*1080p, 1280*720p, VGA, 30FPS</p><p>Video Format: AVI</p><p>Picture Format: JPEG</p><p>Loop Video: Seamless video, no leakage</p><p>ACC Switch Machine: Support</p><p>G-sensor: Support</p><p>Motion Dection: Support</p><p>Microphone: Support</p><p>Parking Monitor: Support (need a voltage-down cable)</p><p>Night Vision: Yes (not IR night vision)</p><p>Mic/Speaker: Yes</p><p>Language Supported: English, Chinese, German, Japanese, Portuguese, Italian, Spanish, Russian, Vietnamese, French</p><p>Memory Card: TF, class 10, up to 32G (not included)</p><p>Interface: 1*TF card slot, 1*Mini USB power port, 1*Video input port</p><p>Input: <strong>DC 12V</strong></p><p>Output: DC 5V</p><p>Battery: Built-in 300mAh 3.7V polymer lithium battery</p><p>Storage Temp.: -30~70°C</p><p>Working Temp.: 0~50°C</p><p>Dash Camera Size: 11.6*6.3*3cm / 4.6*2.5*1.2" (L*W*H)</p><p>Rear Camera Size: 2.3*2.3*2.3cm / 0.9*0.9*0.9" (L*W*H)</p><p>Net Weight: 0.33kg / 11.6oz</p><p><br></p><p><br></p><p><strong>Package:</strong></p><p>1*Dash camera</p><p>1*Rear camera</p><p>1*Car charger with 3.4m/11ft cable</p><p>1*Vedio cable (5.3m / 17.4ft)</p><p>1*Sucker stand</p><p>1*Dual-side sticker</p><p>2*Screw</p><p>1*English &amp; Chinese user manual</p><p>1*Package box</p><p>Cannot ship to PO boxes.</p><p>International orders (Outside of USA) will be shipped from our China warehouse.</p>',
