    id: 8100597367102,
    title: "4K Action Pro Waterproof All Digital UHD WiFi Camera + RF Remote",
    body_html:
      "<p>Get all the action with depth and clarity in Ultra High Definition 4K Resolution Action Pro Camera.</p>\n<p>This little wonder is waterproof, shockproof, dustproof and records all your activities and also lets you view it live on your cell phone thru a free app for Apple or Android phones! So many features that you will have to take several vacations to use them all </p>\n<p>Just to mention a few of the features like:</p>\n<ul>\n<li>Photo Shoot,</li>\n<li>Video Shoot, </li>\n<li>Burst Photo Shoot,</li>\n<li>WiFi Mode connects to the iOS App or Android App download free and watch your action live on your phone.</li>\n<li>Time-Lapse Video. </li>\n<li>Looping Video. </li>\n<li>Shoot in 4k or 1080p mode. </li>\n<li>100 ft underwater waterproof camera.</li>\n<li>Live-Action View on Cellphone.</li>\n<li>RF remote (with replaceable battery) up to 50 ft. </li>\n<li>Multiple Mounts and accessories included. ( see photo).</li>\n<li>Rechargeable Battery.</li>\n<li>HD port connects to TV or Monitor to view.</li>\n<li>Less than 6 oz wt.</li>\n<li>16 Mega Pixel Camera.</li>\n<li>170 Deg Wide-angle Lens. </li>\n<li>Built-in Gyro stabilizer In-body sensor stabilization Electronic image. Stabilization will greatly reduce camera shake and vibration in order to get the perfect shot every single time.</li>\n<li>Record high-quality and stable video at 4K 3840*2160 30fps and 1080p@60fps to capture the most memorable moments for you.</li>\n<li>Save video on a Micro SD card up to 32GB capacity 10 Cycle Type (not included).</li>\n<li>It comes in Silver, Blue, and Black.</li>\n</ul>\n<p> </p>\n<p> </p>",
