    title: "American DJ INN119 Inno Pocket Z4 Mini Zoom Moving Head LED Light",
    body_html:
      '<p>ADJ Inno Pocket Z4 is a mini ZOOM Moving Head that creates beautiful washes of color with its 10-60-degree beam angle. Its compact size and lightweight makes it ideal for mobile entertainers, small club and bars, roller rinks, bowling centers, churches or any mobile production. Users may control the Inno Pocket Z4 by Sound activation with its 4 built-in shows, the optional ADJ UC IR wireless remote, or use an ADJ DMX controller to create your own light shows. Compatible with the ADJ Airstream IR App. </p><b>Features</b><ul>\n<li>Inno Pocket Z4 Mini Zoom Moving Head LED Light</li>\n<li>High output mini Moving Head with a bright 4 x 10W Quad RGBW LED source</li>\n<li>3 Operational modes: DMX Control, Sound Active Mode &amp; Show Mode</li>\n<li>4 Built-in shows</li>\n<li>Stand Alone Set Up or Master-Slave Configuration</li>\n</ul><b>Specifications</b><ul>\n<li>\n<b>Beam Angle:</b> 10 - 60-degrees</li>\n<li>\n<b>Dimming:</b> 0% - 100%</li>\n<li>\n<b>Linkable:</b> DMX via 3-pin XLR cable</li>\n<li>\n<b>Dimension:</b> 5.5" x 6.75" x 9.75"</li>\n</ul>',
