    id: 8100596875582,
    title: "Battery Charger – Charge on the Go!",
    body_html:
      '<p><span style=\'color: rgb(59, 59, 61); font-family: "Whitney SSm A", "Whitney SSm B", Verdana; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\'>Charging your digital devices isn’t every time possible, especially at the time of sudden or unexpected plans. To meet such impromptu demands and ensure that your mobile stays updated with the battery levels high, a sleek portable charger is what you need.  This amazingly simple USB enabled, the portable charger can brighten up your dead battery of any digital device in minutes and almost instantly. With one charge, it charges the device up to 40 hours.  One needs to charge the charger to ensure all the benefits. The flashing light turns solid when one connects it via computer. The package includes USB to micro USB cable for connecting and charging the flash charger with the help of your computer. The beautiful colors make it adorable and attractive. It can be a great return gift for small parties.  Features: A simple battery charger of the digital gadgets we use today Compatible with iPhone, iPad, Samsung, blackberry and other digital devices Sleek and elegant in design yet sturdy and robust Lightweight and compact in size It can fit your pockets or purses Charges the battery instantly</span></p>',
