    title: "Car Aux Audio Cable 3.5mm Jack Stereo Audio Cable",
    body_html:
      '<span style="font-size:14px"><span style="font-family:Arial,Helvetica,sans-serif"><strong>Features:</strong><br>\n<strong>3.5mm Jack Male to Male</strong><br>\nConnect your phone with 3.5mm input jack to any 3.5mm stereo and output your favorite music.<br>\n<strong>L style 90 Degree Connector Design</strong><br>\nHigh Quality L style 90 Degree Aluminum Connector ensure you listen music freely, reduce the use process bend cable, protect the equipment interface, extend service life.<br>\n<strong>Spring Protects the Connector Better</strong><br>\nThere are two springs to protect the connector from breaking. Making sure a long lifespan.<br>\n<strong>Seamlessly Transmits HiFi Stereo Audio</strong><br>\n3.5mm male-to-male stereo audio cable transmits audio in stereo format.<br>\n<strong>Premium Quality</strong><br>\nMade of pure copper wire and aluminum connector ensure it more secure and quick data transmission. Combination with L Style 90 Degree design guarantee it long service life.<br>\n<strong>Strong Compatibility</strong><br>\nPlug and play, easy to use. Works with any device equipped with standard 3.5mm audio jack or AUX-in port. Great way to connect your device to car stereo, home stereo.<br>\n<br>\n<strong>Specification:</strong><br>\nType: Audio Cable<br>\nMaterial: Copper wire<br>\nItem Quantity: 1 pc<br>\nItem Color: Red<br>\nI/O: 3.5mm male to 3.5mm male<br>\nLength: Approx. 1m / 3.3ft<br>\nNet Weight: 0.013kg / 0.5oz<br>\n<br>\n<strong>Package:</strong><br>\n1* 3.5mm Audio Cable</span></span><p>Cannot ship to PO boxes.</p><p>International orders (Outside of USA) will be shipped from our China warehouse.</p>',
