    body_html:
      '<p>Dragon G4PX Stereo Gaming Headset. </p>\n<p>Whether its for gaming or pure listening to music, this headset will give you the ultimate experience.</p>\n<div>Soft cushion head-pad and ear-pad with adjustable length hinges provides comfort wearing even for hours of usage.</div>\n<div><span data-spm-anchor-id="">Deep Bass for Gaming.</span></div>\n<div>Flexible microphone for exact positioning The Mic is extremely sensitive at picking up sounds and your partner can hear your words clearly.</div>\n<div>Remote Control for sound and Mic.</div>\n<div>LED lights are designed on the earcups, make it look more fashionable and stunning.</div>\n<div> <br>\n</div>\n<div> <br>\n</div>\n<div><strong>Specifications:</strong></div>\n<div>Speaker diameter: 50mm</div>\n<div>Impedance: 32Ohm</div>\n<div>Sensitivity: 114dB +/- 3dB</div>\n<div>Frequency range: 20-20KHz</div>\n<div>Mic dimension: 6.0 * 5.0mm</div>\n<div>Mic sensitivity: -34dB +/- 3dB</div>\n<div>Mic impedance: 2.2kohm</div>\n<div>Directivity: Omnidirectional</div>\n<div>LED working voltage: DC5V +/- 5%</div>\n<div>Working current: Below 100mA</div>\n<div>Headset interface: USB + 3.5mm stereo</div>\n<div>Cable length: Approx. 2.2m / 7.22ft</div>\n<div>Color: White/ Red/Blue</div>\n<div>Headphone size: 20.5 * 5.5 * 20.5cm / 8.1 * 2.2 * 8.1in</div>\n<div>Headphone weight: 333.5g / 11.8oz</div>\n<div>Package size: 22.7 * 20.7 * 9.6cm / 8.9 * 8.1 * 3.8in</div>\n<div>Package weight: 508g / 1.12Lbs</div>\n<div> <br>\n</div>\n<div> <br>\n</div>\n<div><strong>Package content:</strong></div>\n<div>1 * Gaming Headphone</div>\n<div>1 * Adapter cable</div>\n<div> <br>\n</div>',
