    body_html:
      '\n\n\n<p><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">\n<meta http-equiv="Content-Style-Type" content="text/css">\n</p><title></title>\n<meta name="Generator" content="Cocoa HTML Writer">\n<meta name="CocoaVersion" content="2022.5">\n<style type="text/css">\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Arial; color: #000000; background-color: #ffffff}\np.p2 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Arial; color: #000000; background-color: #ffffff; min-height: 14.0px}\nspan.s1 {font-kerning: none}\n</style>\n\n\n\n\n\n<p><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">\n<meta http-equiv="Content-Style-Type" content="text/css">\n</p><title></title>\n<meta name="Generator" content="Cocoa HTML Writer">\n<meta name="CocoaVersion" content="2022.5">\n<style type="text/css">\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Arial; color: #000000; background-color: #ffffff}\np.p2 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Arial; color: #000000; background-color: #ffffff; min-height: 14.0px}\nspan.s1 {font-kerning: none}\n</style>\n\n\n\n<ul>\n<li>It has various industry-leading features, including digital video recording, photo shooting, audio recording, video display, and detachable battery. Making it perfect for vehicle data recording, photo-shooting, outdoor sports, home security, deep-water probing, allowing you to film at any time, anywhere.</li>\n<li>\n\nWith a waterproof casing, allowing you to film 30 meters under water scene.</li>\n<li>\nWith screen display for convenient videos and image playback.</li>\n<li>\n\nDetachable battery for easy replacement and help extend the product lifespan.</li>\n<li>\nRecord videos while charging.</li>\n<li>\n\n8 Megapixel wide-angle lens.</li>\n<li>\nSupports SD card memory expandable up to 32GB (Maximum).</li>\n<li>\n\nSupports multiple video recording formats: 1080P/720P/WVGA</li>\n</ul><p><br>\n<strong>Specification:</strong></p><ul>\n<li>\nLiquid Crystal Display (LCD) 2.0inch</li>\n<li>\n\nLens 170°A+ HD wide-angle lens</li>\n<li>\nLanguages: English / German / French / Spanish / Italian / Portuguese / Chinese Traditional / Chinese Simplified / Japanese / Russian</li>\n<li>\n\nVideo Resolution: 1080P/720P/WVGA</li>\n<li>\nLooping Video: Off/1Min/3Min/5Min/10Min</li>\n<li>\n\nMotion Detection: Off/ON</li>\n<li>\nAudio Record: Off/ON</li>\n<li>\n\nPhoto Resolution: 8M/5M/3M</li>\n<li>\nStorage: Micro SD Card</li>\n<li>\n\nUSB Interface : USB2.0</li>\n<li>\nPower Frequency : 50Hz / 60Hz</li>\n<li>\n\nBattery Capacity: 900MAH</li>\n<li>\nPower Dissipation: 400mA/3.7V</li>\n<li>\n\nCharging Time: About 3hours</li>\n<li>\nOperating System (OS):Windows XP / Vista or Above / Win7 / Mac os</li>\n<li>Materials: Plastic+ Alloy</li>\n</ul>\n<p><br><strong>Package Content:</strong></p><ul>\n<li>\n1 x Sports Digital Camcorder</li>\n<li>\n\n1 x Waterproof Case</li>\n<li>\n1 x Waterproof Case clip</li>\n<li>\n1 x USB Cable</li>\n<li>\n\n1 x Fixed Base</li>\n<li>\n1 x Helmet Bases</li>\n</ul>\n\n\n',
