    id: 8100599071038,
    title: "Lamp Plus 3 in 1 Lamp With Phone Charger, Clock And Thermostat",
    body_html:
      '<div class="features">\n<p data-mce-fragment="1">A multifunctional lamp with a Phone Charger, a Clock, and a Thermostat. </p>\n<p data-mce-fragment="1">Place your wireless charging capable device face up on the charging pad, it\'s that easy to use. With full-range RGB and 400 lumens of brightness, this full-spectrum lamp will create colors as bright and dim or as cool and warm as you’d like. The charger is designed and tested with over-current protection and foreign object detection to ensure safe, efficient charging for all your devices. The built-in Clock and Thermostat show you the room temperature. </p>\n<p data-mce-fragment="1">Customize the ambiance of a room with mood using the touch LED Lamp Plus.</p>\n<p data-mce-fragment="1"><strong data-mce-fragment="1">  SPECIFICATIONS:  </strong></p>\n<ul data-mce-fragment="1">\n<li data-mce-fragment="1">An energy-efficient lamp that has a 180-degree flex neck.</li>\n<li data-mce-fragment="1">Its dimensions measure: 17" Tall x 9" Wide.  </li>\n<li data-mce-fragment="1">3 Temperature modes to choose from cool/neutral/warm and dimmable.</li>\n<li data-mce-fragment="1">Multi-color option settings can easily be changed by sliding your finger along the base of the lamp.</li>\n<li data-mce-fragment="1">It provides up to 400 lumens of brightness.</li>\n<li data-mce-fragment="1">Gives you up to 40,000 hours of lamp life.</li>\n<li data-mce-fragment="1">The Qi charging is compatible with iPhone 11 and 12 iPhone X, 8 Plus, 8, Samsung Galaxy S8, Note, 8, and other Qi wireless-enabled Smartphones.  </li>\n</ul>\n<br>\n<p> </p>\n</div>',
