    body_html:
      '<p><strong><span style="font-size: 16px;">Features:</span></strong><br>\n1. 15 kinds of water patterns + green laser gypsophila. The water ripple effect can be freely combined in single color, two colors, three colors, and four colors. Water ripple effect and laser effect can also be projected separately.<br>\n2. The remote control can control the color of the water ripple, the speed of the water ripple, the water ripple mode, the Bluetooth mode, the water ripple single control, the laser single control, the brightness, the music control, the sound control, the selection mode, the timing function, the switch, etc.<br>\n3. Built-in bluetooth speaker, heavy bass and high sound quality.<br>\n4. Music input method: U disk, Bluetooth, card reader</p><p><br>\n\n<strong><span style="font-size: 16px;">product parameter: </span></strong><br>\n1. Input voltage: 110-220V<br>\n2. Output voltage: 5V/2000MA<br>\n3. LED light source: RGBW2*4W (total 8W)<br>\n4. Laser light source: green light 50mW,<br>\n<strong>5. Power supply mode: USB line power supply.</strong><br>\n6. Music mode: U disk, card reader, Bluetooth<br>\n7. Bluetooth connected name: IGB-002<br>\n8. Packaging material: color box packaging<br>\n9. Packing accessories: lamp body + remote control + USB Android data cable + manual<br>\n10. Product size: 13*13*11CM, net weight: 270G</p><p><br>\n\n<strong><span style="font-size: 16px;"> Packing list: </span></strong><br>\nLED Starry sky light*1<br>\nUSB cable *1, <br>\nmanual *1, <br>\nremote control *1 (with battery)</p><p><br>\n\n<strong><span style="font-size: 16px;">Note:</span></strong><br>\n1. Be careful not to look directly into the laser aperture to avoid eye injury.<br>\n2. This unit is for indoor use only and must be protected from water, moisture, and vibration.</p>',
