    body_html:
      '<p>Ninja Dragon Z10 HiFi Stereo Bluetooth Headphones</p>\n<p>This headphone is foldable and easy to carry around. Providing outstanding sound quality.</p>\n<div>Equipped with  <span data-spm-anchor-id="">Bluetooth 5.0 + MP3 function. </span> Support both stereo music playing and phone calling.</div>\n<div> </div>\n<div><span data-spm-anchor-id="">This Z10  Support all audio devices that have Bluetooth capability, such as, cell phone ,tablet PC,laptop,computer etc.</span></div>\n<div> </div>\n<div>Built in 3.5mm audio jack cable provides an alternative wired connection for devices without Bluetooth.</div>\n<div> </div>\n<div><span data-spm-anchor-id="">Allow you to answer or reject phone calls.</span></div>\n<div> </div>\n<div>Charged via USB, rechargeable battery, convenient and practical.</div>\n<div> </div>\n<div>Up to 10 hours of playing music or  2.5 hours of talk time and up to 20 days standby on a single charge.</div>\n<div> </div>\n<div>Latest Bluetooth technology providing it up to 32 ft distance.</div>\n<div> </div>\n<div><span data-spm-anchor-id="">Foldable design and adjustable length hinges, Comfortable to wear and easy to carry.</span></div>\n<div> </div>\n<div>Build-In TF Slot and maximum support 32GB TF card. (Note: The TF card is not included)</div>\n<div> </div>\n<div>LED breathing light can switch automatically in 7 colors.</div>\n<div> </div>\n<div> </div>\n<div data-spm-anchor-id=""> </div>',
