      "<p>Liane V x Fifth &amp; Ninth</p><p><br></p><p>As someone who is in front of the camera all of the time, it is very important for me to make sure my hair and make-up is always on point! Having a mirror as a phone case is super helpful and always comes in handy when I want to check if I have lipstick (or food) in my teeth! My friends are constantly asking me if they could use my phone case to check their make-up and hair. I also added some of my favorite inspirational words on the cases because it’s always good to remind yourself to stay positive, reflect love, and be happy! I’m so excited to create something unique and inspirational for all of you! I hope this case makes you smile.</p><p><br></p><ul>\n<li>Fits the iPhone X/XS</li>\n<li>5 Star Rated Protection</li>\n<li>Raised shock-absorbent sides for full 360º screen and camera protection</li>\n<li>Raised edges to avoid contact with surface when face down</li>\n<li>Access to all ports with easy press buttons</li>\n<li>Slim &amp; lightweight</li>\n</ul>",
